<script>

let gs;

(async () => {
	// Initialize the Emscripten module
	const Module = await createGotScoreModule();

	// Create persistent GotScore instance
	gs = new Module.GotScore();
   
	// Add event listener to select menu
	const selectElement = document.getElementById('choice');
	selectElement.addEventListener('change', function(event) {
		const score = event.target.value;
		if (score) {
			downloadAndConvertScore(score);
		}
	});
  }
)();


function downloadAndConvertScore(score) {
	const macroId = "AKfycbyfQZ_Dcn08qqRgXrXtQ3SE9gjznlk8s7sRDIup7rzQTOIDDP7w_S4CiBtRdkwcxM5cVQ";
	const url = `https://script.google.com/macros/s/${macroId}/exec?format=tsv&id=${score}`;

	fetch(url)
	.then(resp => {
		if (!resp.ok) {
			throw new Error(`HTTP ${resp.status}`);
		}
		return resp.text();
	})
	.then(tsvData => {
		// 1. Dump raw TSV into the page
		const tsvElement = document.querySelector("#tsv");
		tsvElement.innerHTML = tsvData;

		// 2. Load it into GotScore
		gs.loadLines(tsvData);

		// 3. Extract your conversions
		const gotHum = gs.getGotHumdrum();
		const kernHum = gs.getKernHumdrum();

		// 4. Dump converted output into the page
		document.querySelector("#got").innerHTML  = gotHum;
		document.querySelector("#kern").innerHTML = kernHum;
	})
	.catch(err => {
		console.error("Failed to load/parse TSV data:", err);
	});
}


</script>
